Here is a simple HTML5 website that includes some basic elements and styles:
```
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Simple HTML5 Website</title>
  <style>
    /* Global Styles */
    * {
      box-sizing: border-box;
      margin: 0;
      padding: 0;
    }

    /* Header Styles */
    header {
      background-color: #333;
      color: #fff;
      text-align: center;
      padding: 20px;
      border-bottom: 1px solid #ccc;
    }

    /* Main Content Styles */
    main {
      display: flex;
      flex-direction: column;
      align-items: center;
      padding: 20px;
    }

    /* Footer Styles */
    footer {
      background-color: #333;
      color: #fff;
      text-align: center;
      padding: 10px;
      border-top: 1px solid #ccc;
    }
  </style>
</head>
<body>
  <!-- Header -->
  <header>
    <h1>Welcome to My Website!</h1>
  </header>

  <!-- Main Content -->
  <main>
    <section>
      <h2>About Me</h2>
      <p>I'm a simple HTML5 website, built with love and care.</p>
    </section>
    <section>
      <h2>My Skills</h2>
      <ul>
        <li>HTML5</li>
        <li>CSS3</li>
        <li>JavaScript ( basic)</li>
      </ul>
    </section>
  </main>

  <!-- Footer -->
  <footer>
    <p>&copy; 2023 My Website. All rights reserved.</p>
  </footer>
</body>
</html>
```
This code includes:

* A basic HTML5 document structure
* A simple header with a title and background color
* A main content section with two sections: "About Me" and "My Skills"
* A footer with a copyright notice

You can save this code to an HTML file (e.g., `index.html`) and open it in a web browser to see the website in action.

Note that this is just a basic example, and you can customize the styles and content to fit your needs.
